import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import App from './App';
import AppManager from './AppManager';
import AppSupervisor from './AppSupervisor';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
    <Router>
      <AppSupervisor />
    <Routes>
      <Route path = "/supervisor" element = {<Agents/>}/>
      <Route path="/supervisor/dashboard" element={<AgentDashboard />} />
     <Route path="/supervisor/profile" element={<AgentFilter />} />
      <Route path="/supervisor/profile/:agentId" element={<AgentStatistics />} />
    </Routes>
  </Router>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
